import React, { useState } from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faUser, faPen } from '@fortawesome/free-solid-svg-icons'
// import { UserModal } from './components/UserModal'

export const User = (open, onClose) => {
    const [openUserModal, setOpenUserModal] = useState(false);

    return(
        <div>
            <button className="User" onClick={() => {
                setOpenUserModal(true);
            }}>
                <FontAwesomeIcon icon={faUser} style={{color: "#ffffff",}} className="user-icon"/>
            </button>
            <div className="modalBackground">
                <div className="modalContainer">
                    <button type="button" className="close-btn" onClick={onClose}>x</button>
                    <User />
                    <p>User<button type="button"><FontAwesomeIcon icon={faPen} /></button></p>
                    <button type="button">Change Name</button>
                    <button type="button">Save Name</button> 
                    <button type="button">Logout</button>
                </div>
            </div>
            {/* <UserModal open={openUserModal} onClose={() => setOpenUserModal(false)}></UserModal> */}
        </div>

    )
}
